<div class="elementor-text-editor elementor-clearfix">
<p>Small orders are shipped inside magazines or binders, Large orders are shipped in boxes with labeling to appear like an Ebay or Amazon.com package. Additional stealth precautions are taken that we don’t publicly share. Please let us know if you have special requirements.</p>
<p><strong>Items via Email: </strong></p>
<p><strong>(Gift Cards, Credit/Debit Cards, Transfers,</strong><strong>etc):</strong></p>
<p>Items sent via email do not require any identity information such as name, address, etc. You can enter random characters as an alternative. Client receives response within 1 – 3 hrs. If there is a case of mass digital goods orders, receiving your order may take up to 5hrs. We advise you to be patient as we will respond to you accordingly.</p>
